- input: "TEXT\x1CC00089243\x1C.TEXT\x1C\x1CF3XA\x1CThis amended report includes Memo
    Schedule A entries for contributions raised by the DNC State Party Victory Fund
    program.  The committee may not have received its share of the proceeds as of
    the end of the reporting period.  The committee expects to receive transfers at
    some point in the three months following this reporting period.  The rent figure
    charged to the Martha Coakley Committee and the Patrick-Murray Inauguration Committee
    was based on square footage occupied by each entity.  Based on the per square
    foot cost outlined in our lease and the square footage occupied by each entity,
    we arrived at the rental figure.  In neither case is the sublessor paying more
    than the usual and normal charge as reflected in our lease."
